import React, {useState} from "react";
import {Link} from "react-router-dom";
import {Button} from "@material-ui/core";
import ReqCard from "./ReqCard.js";
import axios from "axios";
import {createUseStyles} from "react-jss";

const useStyles = createUseStyles({
  cards: {
    display: "flex",
    flexDirection: "row",
    flexWrap: "wrap"
  },
  linkToPage: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "space-around",
    borderRadius: "5px",
    border: "2px solid rgba(53, 59, 64, 0.66)",
    boxShadow: "5px 5px 10px gray",
    width: "max-content",
    maxWidth: "350px",
    height: "min-content",
    margin: "10px",
    padding: "15px",
    boxSizing: "border-box",
    alignSelf: "center"
  }
});

function GetHistOfReq() {
  const [reqs, getReqs] = useState([]);
  const classes = useStyles();
  axios.get("/history").then(resp => getReqs(resp.data));
  return (
    <React.Fragment>
      <div className={classes.cards}>
        {reqs.map(el => (
          <ReqCard
            num={JSON.parse(el.number)}
            fibNum={JSON.parse(el.fibNumber)}
            date={el.date}
          />
        ))}
      </div>
      <Link className={classes.linkToPage} to="/Fibbonnacci">
        {" "}
        get num{" "}
      </Link>
    </React.Fragment>
  );
}

export default GetHistOfReq;
